import React from 'react';
import Navbar from './Navbar.js'
import Banner from './banner.jpeg'


const Home = () => {
    return ( 
        <div className="home">
          <Navbar />
          <img src={Banner} alt="Banner" style={{
              flex: 1,
              width: '100%',
              height: '100%',
              alignItems: "stretch",
              resizeMode: 'contain',
            }}/>
        </div>
     );
}

export default Home;
